BEGIN
  RETURN a + b;
END;
$$;

//Check grade.
CREATE FUNCTION check_grade(score INT)
RETURNS TEXT
LANGUAGE plpgsql
AS $$
BEGIN
  IF score < 0 OR score > 100 THEN
    RAISE EXCEPTION 'Xato qiymat kiritdingiz';
  END IF;

  IF score >= 80 THEN 
    RETURN 'Excellent';
  ELSE
    RETURN 'Average';
  END IF;
END;
$$;

// Get top students;
CREATE FUNCTION get_top_students(min_score INT)
RETURNS TABLE(id INT, name TEXT, score INT)
LANGUAGE plpgsql
AS $$
BEGIN 
  RETURN QUERY
  SELECT 
    s.id, 
    s.full_name, 
    s.score
  FROM students s
  WHERE s.score >= min_score;
END;
$$;

// Variable 
CREATE FUNCTION add_numbers(a INT, b INT)
RETURNS INT
LANGUAGE plpgsql
AS $$
DECLARE
  result INT;
BEGIN
  result := a * b;
  RETURN result;
END
$$

